INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, "カオリ（サマー）", 24015, 1, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 4, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 24, 0.0, 10021, 4, 110501);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, "カオリ（サマー）", 24016, 2, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 1, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 24, 4.0, 10021, 4, 110501);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, "カオリ（サマー）", 24017, 3, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 4, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 24, 0.0, 10021, 4, 110501);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, "カオリ（サマー）", 24018, 4, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 2, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 24, 5.2, 10021, 1, 110501);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, "カオリ（サマー）", 24019, 5, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 6, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 24, 4.2, 10021, 5, 110501);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, "カオリ（サマー）", 24020, 6, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 2, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 24, 0.0, 10021, 2, 110501);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, "カオリ（サマー）", 24021, 7, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 6, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 24, 6.4, 10021, 1, 110501);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, "カオリ（サマー）", 24022, 8, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 2, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 24, 0.0, 10021, 2, 110501);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, "カオリ（サマー）", 24023, 9, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 3, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 24, 10.08, 10021, 6, 110501);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, "カオリ（サマー）", 24024, 10, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 2, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 24, 5.0, 10021, 1, 110501);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, "カオリ（サマー）", 24025, 11, 0.0, "2030/12/17 14:59:59", "2019/07/31 12:00:00", 2, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 24, 0.0, 10021, 2, 110501);
